(def colors
  (let [c ["black" "aqua" "blue" "fuchsia" "gray"
           "green" "lime" "maroon" "navy" "olive"
           "orange" "purple" "red" "silver" "teal"]]
    (zipmap (range (count c)) c)))


(def min-pts 2)

(for [epsilon [0.3 0.1 0.03]]
  (let [clustering (dbscan euclidean epsilon min-pts points)]
    (apply plot/compose
           (conj (for [[id pts] (group-by val clustering)]
                   (plot/list-plot (map first pts)
                                   :color (get colors id)
                                   :plot-range [[0 1] [0 1]]))
                 (plot/list-plot (filter #(not (contains? clustering %)) points)
                                 :color (get colors 0)
                                 :plot-range [[0 1] [0 1]])))))
